function Szukaj({setInput}){
    
    return(
        <div className="flex flex-col items-center w-full h-[60px] gap-2 bg-green-600 pb-2">
            <input className="rounded" onChange={(e)=>{setInput(e.target.value)}}/>
            <button>Szukaj</button>
        </div>
    );
}
export default Szukaj;
